import styled from 'styled-components'

export const Container = styled.div`
    width: 100%;
    height: 80px;
    background: rgba(52, 69, 225, 0.76);
    border-bottom: 3px solid #893DCC;

    img{
        width: 170px;
        height: 60px;
        padding-top: 5px;
        padding-left: 10px;
    }
`
